let Z = 0
function draw() {
    background("#10101a");
    orbitControl();

    Z-=10
    rotateX(-0.3);
    rotateY(-0.2);
    translate(0, 0, Z);

    stroke('rgb(255, 255, 102)');
    for (i = 0; i < S.length; ++i) {
        let u = S[i];
        push();
        rotateZ(millis() / 100000);
        rotateX(millis() / 10000);
        rotateY(millis() / 1000);
        translate(u[0], u[1], u[2]);
        sphere(20);
        pop();
    }

    stroke('rgb(199,103,239)');
    for (i = 0; i < R.length; ++i) {
        let u = R[i].origin;
        push();
        rotateZ(millis() / 100000);
        rotateX(millis() / 10000);
        rotateY(millis() / 1000);
        translate(u[0], u[1], u[2]);
        sphere(40);
        pop();
    }

    stroke('rgb(103,239,110)');
    for (i = 0; i < R.length; ++i) {
        for (j = 0; j < R[i].points.length; ++j) {
            let u = R[i].points[j];
            push();
            rotateZ(millis() / 100000);
            rotateX(millis() / 10000);
            rotateY(millis() / 1000);
            translate(u[0], u[1], u[2]);
            sphere(20);
            pop();
        }
    }
}
